import React from 'react';
import { BrowserRouter as Router,Switch, Route, Redirect } from "react-router-dom";
import Header from './Components/header';
//import Footer from './Components/footer';
import Gallery from './Pages/gallery';
import bottleHolders from '../imgs/bottleHolders';
import lunchBoxes from '../imgs/lunchboxes';
import makeupBags from '../imgs/makeupBags';
import pencilCases from '../imgs/pencilcases';

const Routes = ()=>{
    return(
        <Router>
        <Header/>
        <Switch>
            <Route path="/loncheras">
                <Gallery imgsDetails={lunchBoxes}/>;
            </Route>
            <Route path="/estucheras">
                <Gallery imgsDetails={pencilCases}/>
            </Route>
            <Route path="/cosmetiqueras">
                <Gallery imgsDetails={makeupBags}/>
                </Route>
            <Route path="/portabotellas">
                <Gallery imgsDetails={bottleHolders}/>
                </Route>
            <Redirect to="/loncheras"/>

        </Switch>
    </Router>
    );

}

export default Routes;
